-- ----------------------------
-- View structure for orderform
-- ----------------------------
DROP VIEW IF EXISTS `orderform`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER  VIEW `orderform` AS SELECT DISTINCT ctr.id, ctr.car_id,ctr.order_time,ctr.contract_amount,ctr.salesperson ,CONCAT(car.name,' ',car.style) car_name FROM crm_contract ctr ,crm_car car
where ctr.car_id = car.id ;
